// src/App.js

import React from 'react';
import './App.css';
import ComputadoresList from './ComputadoresList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Gerenciador de Computadores</h1>
      </header>
      <main>
        <ComputadoresList />
      </main>
    </div>
  );
}

export default App;
